  const [courses, setCourses] = useState([]);
  useEffect(() => {
    getCourses().then((data) => {
      setCourses(data.Valute);
    });
  }, []);

  console.log(courses);


  return (
    <>
      <Header />
      <main className="main">
        <Courses/>
      </main>
      <Footer />
    </>
  );
}

export default App;
